import React from "react";

function Card({name,img,types}){

    return(
        <div>
            <h3>{props.name}</h3>
            <img src={props.img} alt={props.name}></img>
            <p>{props.types?.map(e=>e.name).join(" ")}</p>
        </div>
    )
}

export default Card;
